import React from "react";

async function CoinCourse() {
    let response = await fetch('https://jsonplaceholder.typicode.com/todos');
    let bitcoin = await response.json();
    return (
        <div>
            <h1>Курс</h1>
            <h2>{bitcoin}</h2>
        </div>
    );
}

export default CoinCourse;
